import React from 'react';
import './Card.css';

const Card = (props) => {

    return (
        <div className='wrapper'>
            <table>
                <th>
                    <tr>
                        <p>id:{props.id}</p>
                        <p>name:{props.name}</p>
                        <p>date:{props.date}</p>
                    </tr>
                </th>
            </table>
        </div>
    );
};

export default Card;
